import React from 'react';

function Menu(props) {
    return (
        <menu>
            <li><a href="#">ПАРКОВКА</a></li>
            <li><a href="#">СТРАХОВКА</a></li>
            <li><a href="#">БЕНЗИН</a></li>
            <li><a href="#">ОБСЛУЖИВАНИЕ</a></li>
            <ol>
                <li><a href="#"></a></li>
                <li><a href="#"></a></li>
                <li><a href="#"></a></li>
            </ol>
        </menu>
    );
}

export default Menu;
